        select 
          CMP_ID, 
          CCL_NAME "CLASS", 
          CMP_NAME "COMPONENT"
        from 
          CDW_COMPONENTS 
          join CDW_COMPONENT_CLASSES 
            on (CMP_CCL_ID = CCL_ID)
        

